import styles from "./styles.scss";

export default ({ src, price, title }) => (
  <div style={styles.seckillItem}>
    <img style={styles.img} src={src} />
    <span style={styles.price}>￥{price}</span>
    <span style={styles.tile}>{title}</span>
    <button style={styles.btn}>购买</button>
  </div>
);
